package splash

import (
	"encoding/base64"
	"image"
	"image/draw"
	"strings"

	"gocv.io/x/gocv"

	"github.com/pidgy/unitehud/core/notify"
)

var defaultPNG = func() *image.RGBA {
	reader := base64.NewDecoder(base64.StdEncoding, strings.NewReader(defaultb64))
	i, _, err := image.Decode(reader)
	if err != nil {
		panic(err)
	}

	b := i.Bounds()
	rgba := image.NewRGBA(image.Rect(0, 0, b.Dx(), b.Dy()))
	draw.Draw(rgba, rgba.Bounds(), i, b.Min, draw.Src)

	return rgba
}()

func defaultPNGToMat() gocv.Mat {
	m, err := gocv.ImageToMatRGBA(defaultPNG)
	if err != nil {
		notify.Warn("Splash: Failed to convert default image to matrix")
		return gocv.Mat{}
	}
	return m
}

var defaultb64 = ``
